syntax = "proto3";

package ReMastersLib;

message MoveAndPassiveSkillDigit {
	int64 moveAndPassiveSkill_id = 1;
	int32 digit0 = 2;
	int32 digit1 = 3;
	int32 digit2 = 4;
	int32 digit3 = 5;
	int32 digit4 = 6;
	int32 digit5 = 7;
	int32 u8 = 8;
	int32 u9 = 9;
	int32 u10 = 10;
	int32 u11 = 11;
}

message MoveAndPassiveSkillDigitTable {
	repeated MoveAndPassiveSkillDigit entries = 1;
}
